import React from 'react';
import './ResumePage.css';

const ResumePage = () => {
    return (
        <div className="resume-page">
            <h1>My Resume</h1>
            <p>Click the link below to download my resume:</p>
            <a href="/personal-e-portfolio/resume.pdf" download>
                Download Resume
            </a>
        </div>
    );
};

export default ResumePage;
